import React from "react";

const Progress = () => {
const [submitMessage, setSubmitMessage]=React.useState('');

  const handleSubmit = (event)=> {
    event.preventDefault();
    setSubmitMessage('Your progress chart will be available in 24 hours')
  }
  return(
    <div>
      <form>
        <label>Name:</label>
        <input type='text' placeholder='Name' required></input>
        <label>Email:</label>
        <input type='text' placeholder='Email' required></input>
        <label>Cours ID:</label>
        <input type='text' placeholder='ID' required></input>
        <button type='submit' style={{color: 'green'}} onSubmit={handleSubmit}>Submit</button>
        {submitMessage!=='' ? <div>{setSubmitMessage}</div>:null}
      </form>
    </div>
  )
}
export default Progress;
